        public IWeatherDataGetter? Data => _DataLocation.HasValue ? WeatherDataBinaryOverlay.WeatherDataFactory(_recordData.Slice(_DataLocation!.Value.Min), _package) : default;
        #endregion
        public IReadOnlyList<IWeatherSoundGetter> Sounds { get; private set; } = Array.Empty<IWeatherSoundGetter>();
        partial void CustomFactoryEnd(
            OverlayStream stream,
            int finalPos,
            int offset);

        partial void CustomCtor();
        protected WeatherBinaryOverlay(
            MemoryPair memoryPair,
            BinaryOverlayFactoryPackage package)
            : base(
                memoryPair: memoryPair,
                package: package)
        {
            this.CustomCtor();
        }

        public static IWeatherGetter WeatherFactory(
            OverlayStream stream,
            BinaryOverlayFactoryPackage package,
            TypedParseParams translationParams = default)
        {
            stream = Decompression.DecompressStream(stream);
            stream = ExtractRecordMemory(
                stream: stream,
                meta: package.MetaData.Constants,
                memoryPair: out var memoryPair,
                offset: out var offset,
                finalPos: out var finalPos);
            var ret = new WeatherBinaryOverlay(
                memoryPair: memoryPair,
                package: package);
            ret._package.FormVersion = ret;
            ret.CustomFactoryEnd(
                stream: stream,
                finalPos: finalPos,
                offset: offset);
            ret.FillSubrecordTypes(
                majorReference: ret,
                stream: stream,
                finalPos: finalPos,
                offset: offset,
                translationParams: translationParams,
                fill: ret.FillRecordType);
            return ret;
        }

        public static IWeatherGetter WeatherFactory(
            ReadOnlyMemorySlice<byte> slice,
            BinaryOverlayFactoryPackage package,
            TypedParseParams translationParams = default)
        {
            return WeatherFactory(
                stream: new OverlayStream(slice, package),
                package: package,
                translationParams: translationParams);
        }

        public override ParseResult FillRecordType(
            OverlayStream stream,
            int finalPos,
            int offset,
            RecordType type,
            PreviousParse lastParsed,
            Dictionary<RecordType, int>? recordParseCount,
            TypedParseParams translationParams = default)
        {
            type = translationParams.ConvertToStandard(type);
            switch (type.TypeInt)
            {
                case RecordTypeInts.CNAM:
                {
                    _TextureLowerLayerLocation = (stream.Position - offset);
                    return (int)Weather_FieldIndex.TextureLowerLayer;
                }
                case RecordTypeInts.DNAM:
                {
                    _TextureUpperLayerLocation = (stream.Position - offset);
                    return (int)Weather_FieldIndex.TextureUpperLayer;
                }
                case RecordTypeInts.MODL:
                {
                    this.Model = ModelBinaryOverlay.ModelFactory(
                        stream: stream,
                        package: _package,
                        translationParams: translationParams.DoNotShortCircuit());
                    return (int)Weather_FieldIndex.Model;
                }
                case RecordTypeInts.NAM0:
                {
                    this.Colors = BinaryOverlayList.FactoryByStartIndexWithTrigger<IWeatherColorsGetter>(
                        stream: stream,
                        package: _package,
                        finalPos: finalPos,
                        itemLength: 16,
                        getter: (s, p) => WeatherColorsBinaryOverlay.WeatherColorsFactory(s, p));
                    return (int)Weather_FieldIndex.Colors;
                }
                case RecordTypeInts.FNAM:
                {
                    _FogDistanceLocation = new RangeInt32((stream.Position - offset), finalPos - offset);
                    return (int)Weather_FieldIndex.FogDistance;
                }
                case RecordTypeInts.HNAM:
                {
                    _HDRDataLocation = new RangeInt32((stream.Position - offset), finalPos - offset);
                    return (int)Weather_FieldIndex.HDRData;
                }
                case RecordTypeInts.DATA:
                {
                    _DataLocation = new RangeInt32((stream.Position - offset), finalPos - offset);
                    return (int)Weather_FieldIndex.Data;
                }
                case RecordTypeInts.SNAM:
                {
                    this.Sounds = BinaryOverlayList.FactoryByArray<IWeatherSoundGetter>(
                        mem: stream.RemainingMemory,
                        package: _package,
                        translationParams: translationParams,
                        getter: (s, p, recConv) => WeatherSoundBinaryOverlay.WeatherSoundFactory(new OverlayStream(s, p), p, recConv),
                        locs: ParseRecordLocations(
                            stream: stream,
                            trigger: WeatherSound_Registration.TriggerSpecs,
                            triggersAlwaysAreNewRecords: true,
                            constants: _package.MetaData.Constants.SubConstants,
                            skipHeader: false));
                    return (int)Weather_FieldIndex.Sounds;
                }
                default:
                    return base.FillRecordType(
                        stream: stream,
                        finalPos: finalPos,
                        offset: offset,
                        type: type,
                        lastParsed: lastParsed,
                        recordParseCount: recordParseCount,
                        translationParams: translationParams.WithNoConverter());
            }
        }
